import {Route} from 'react-router-dom'

import Welcome from './components/welcome';

function App() {
  return (
    <div>
      <header>

      </header>
      <main>
        <Route path='/'>
          <Welcome/>
        </Route>
        <Route path='/welcome'>
          <Welcome/>
        </Route>
      </main>
    </div>
  );
}

export default App;
